DROP FUNCTION IF EXISTS `checkU`;
delimiter ;;
CREATE FUNCTION `checkU`(un VARCHAR(16),pw VARCHAR(16))
 RETURNS int
  DETERMINISTIC
BEGIN
	#Routine body goes here...
	DECLARE realpw VARCHAR(16);
 SELECT password from user where username=un into realpw;
	RETURN if(pw=realpw,1,0);
END
;;
