-- ----------------------------
-- Function structure for forSale
-- ----------------------------
DROP FUNCTION IF EXISTS `forSale`;
delimiter ;;
CREATE FUNCTION `forSale`(numSale int)
 RETURNS int
  DETERMINISTIC
BEGIN
	#Routine body goes here...
	UPDATE sale set num=num-numSale WHERE `status`="库存";
	UPDATE sale set num=num+numSale WHERE `status`="售出";
	RETURN 0;
END
;;
delimiter ;

