delimiter ;;
CREATE FUNCTION `newUser`(un VARCHAR(16),pw VARCHAR(80))
 RETURNS int
  DETERMINISTIC
BEGIN
	#Routine body goes here...
	DECLARE MAXI int;
	SELECT MAX(uid)+1 from `user` INTO MAXI;
	insert into `user`(uid,username,`password`) values(MAXI,un,pw);
	insert into `aa`(accid) values(MAXI);
	insert into `latex`(uid) values(MAXI);
	RETURN MAXI;
END
;;
