delimiter ;;
CREATE FUNCTION `reg`(username VARCHAR(20),psw VARCHAR(200),valid int)
 RETURNS int
  DETERMINISTIC
BEGIN
	#Routine body goes here...
	DECLARE s int;
	SELECT max(uid)+1 from user into s;
	INSERT INTO `user`(uid,username,password,valid) VALUES (s,username,psw,valid);
	INSERT INTO aa(accid,`aid`) VALUES (s,valid);
	RETURN 0;
END
;;
