-- ----------------------------
DROP FUNCTION IF EXISTS `sendBack`;
delimiter ;;
CREATE FUNCTION `sendBack`(numSale int)
 RETURNS int
  DETERMINISTIC
BEGIN
	UPDATE sale set num=num+numSale WHERE `status`="库存";
	UPDATE sale set num=num-numSale WHERE `status`="售出";
	RETURN 0;
END
;;
delimiter ;

